import React, {Component} from 'react';

class Items extends Component{
    render(){
        return(
            <div>
                {<p>{this.props.id}</p>}
                {<p>{this.props.name}</p>}
                {<p>{this.props.age}</p>}
            </div>
        );
    }
}

export default Items;
